import React from "react";
import Card from "react-bootstrap/Card";

function BookingCardComponent({ booking }) {
  const { booking_id, flight_id, passenger_id, booking_date, status } = booking;

  return (
    <Card style={{ width: "18rem", margin: "1rem" }}>
      <Card.Body>
        <Card.Title>Booking ID: {booking_id}</Card.Title>
        <Card.Text>
          <strong>Flight ID:</strong> {flight_id}
          <br />
          <strong>Passenger ID:</strong> {passenger_id}
          <br />
          <strong>Booking Date:</strong>{" "}
          {new Date(booking_date).toLocaleString()}
          <br />
          <strong>Status:</strong> {status} <br />
          <strong>
          <button class="custom-button">
  <span class="text">Cancel</span>
  <span class="icon">
    <svg xmlns="http://www.w3.org/2000/svg" width="24" height="24" viewBox="0 0 24 24">
      <path d="M24 20.188l-8.315-8.209 8.2-8.282-3.697-3.697-8.212 8.318-8.31-8.203-3.666 3.666 8.321 8.24-8.206 8.313 3.666 3.666 8.237-8.318 8.285 8.203z"></path>
    </svg>
  </span>
</button>

          </strong>
        </Card.Text>
      </Card.Body>
    </Card>
  );
}

export default BookingCardComponent;
